import React, { useState } from 'react';
import Button from './ui/Button';
import logo from '../img/logo_sech_white.svg';
import Booking from './AboutPage/Booking';
import styled from 'styled-components';
import '../CSS/main.css'

export default function Header() {
  const [modalActive, setModalActive] = useState(false)

  return (
    <footer className="footer">
      <div className="container flex header-container">
        <nav className="header-nav flex">
          <a href="/" className="header-logo footer-logo">
            <img src={logo} alt="олготип Сеченовского Университета" />
          </a>
          <ul className="footer-list list-reset flex">
            <li className="footer-list-item">
              <a href="/">Главная</a> 
            </li>
            <li className="footer-list-item">
              <a href="/about">О клинике</a>
            </li>
            <li className="footer-list-item">
              <a href="/prices">Цены</a>
            </li>
            <li className="footer-list-item">
              <a href="/hcp">Врачи</a>
            </li>
            <li className="footer-list-item">
              <a href="/blog">Блог</a>
            </li>
          </ul>
        </nav>

        <div className='footer-interact flex'>
          <a className="header-interact-tel" href="tel:+78008888888">+7 800 888 88 88</a>
          <DarkButton onClick={() => setModalActive(true)}>Записаться на прием</DarkButton>  
        </div>
        <Booking active={modalActive} setActive={setModalActive}/>
      </div>
    </footer>
  )
}

const DarkButton = styled.button`
  border: 1px solid white;
  border-radius: 30px;
  padding: 16px 40px;
  color: white;
  background-color: #415279;
  cursor: pointer;
`;
